import React from 'react'
import styled from 'styled-components';

const OuterBorder = styled.div`
  width: 100%;
  height: 685px;
  padding: 0;
  margin: 13px 0px;
  border: solid 2px;
`;

const CreateBar = styled.div`
  font-family: "Lucida Console", monospace;
  width: 100%;
  height: 6%;
  padding: 6px;
  border-bottom: 2px solid;
  font-size: 22px;
`;

const EditBorder = styled.nav`
  width: 40%;
  height: 607px;
  border-right: 2px solid;
  font-family: 'Arial', sans-serif;
  font-size: 18px;
  overflow: scroll;
`;

const InfoBar = styled.div`
  font-family: "Lucida Console", monospace;
  font-size: 22px;
  align-content: center;
  border-bottom: 2px solid;
  padding-left: 10.5%;
  width: 40%;
  border-right: 2px solid;
`;

const SafetyInfo = styled.div`
    font-family: 'Arial', sans-serif;
    font-size: 19px;
    text-align: center;
    width: 30%;
    height: 33%;
    position: absolute;
    right: 30%;
    top: 57%;
    border: 2px solid;
`;

const PhoneInfo = styled.div`
    font-family: 'Arial', sans-serif;
    font-size: 19px;
    text-align: center;
    width: 30%;
    height: 33%;
    position: absolute;
    left: 69.9%;
    top: 57%;
    border: 2px solid;
`;

const ReportInfo = styled.div`
    border: 2px solid;
    font-family: 'Arial', sans-serif;
    font-size: 16px;
    padding: 5px;
    text-align: center;
    width: 17%;
    height: 43.3%;
    position: absolute;
    right: 43%;
    top: 14%;
`;

const Box = styled.div`
    border-bottom: 2px solid;   
    height: 14%;
    margin-bottom: 4px;
`;

const styleGray = {backgroundColor : '#AFAFAF'};
export default function EditPage() {
return (
    <>
    <OuterBorder>
    <CreateBar> Edit a new Attraction </CreateBar>
    <InfoBar> Basic Information</InfoBar>
    <EditBorder>

        <table className="table table-bordered table-striped">
        <thead>
          <tr style = {styleGray}>
            <th scope="col">Property</th>
            <th scope="col">Value</th>
          </tr>
        </thead>
        <tbody>

        <tr>
        <td>Name</td>
        <td>The Joker</td>
        </tr>

        <tr>
        <td>Model</td>
        <th> </th>
        </tr>

        <tr>
        <td>Area</td>
        <th></th>
        </tr>

        <tr>
        <td>Theoretical Capacity</td>
        <th></th>
        </tr>

        <tr>
        <td>Target Capacity</td>
        <th></th>
        </tr>

        <tr>
        <td>Max Vehicles</td>
        <th></th>
        </tr>

        <tr>
        <td>Min Vehicles</td>
        <th ></th>
        </tr>

        <tr>
        <td>Seats per Vehicle</td>
        <th></th>
        </tr>

        <tr>
        <td>Max Employees</td>
        <th ></th>
        </tr>

        <tr>
        <td>Min Employees</td>
        <th ></th>
        </tr>

        <tr>
        <td>Power Requirement</td>
        <th ></th>
        </tr>

        <tr>
        <td>Max Height</td>
        <th></th>
        </tr>

        <tr>
        <td>Track Length</td>
        <th></th>
        </tr>
        
        </tbody>
        </table>
    </EditBorder>
    <ReportInfo>
        <Box> 
        Required <ul>  Documentation</ul> </Box>
        <ul>Operations Report</ul>  
        <ul>Turnstile Report</ul> 
        <ul>Lockout Report</ul>
    </ReportInfo>
    <SafetyInfo>Safety Critical Information</SafetyInfo>
    <PhoneInfo>Phone Information</PhoneInfo>
    </OuterBorder>
    </>
    );
}
